  merge(args, overrides);
  const contentStyle = getContentStyle();
  return <PanelChrome {...args}>
      {(width: number, height: number) => <div style={{
      height,
      width,
      ...contentStyle
    }}>Panel in a loading state</div>}
    </PanelChrome>;
